#include <stdio.h>
#include <string.h>

char place[400][100],from[100],to[100];
int start[400], d[400][400];
struct tt {
   int go, dur;
} travel[400];
int nt;

int comp(struct tt *a, struct tt*b) {
   if (a->go == b->go) return b->dur-a->dur;
   return a->go - b->go;
};

int s,z,i,j,k,m,h,n,N,T,S,time;

main(){
   scanf("%d",&N);
   while (N--) {
      if (z++) printf("\n");
      memset(d,32,sizeof(d));
      scanf("%d",&T);
      s = 0;
      for (i=0;i<T;i++) {
         scanf("%d %d:%d",&S,&h,&m);
         start[s] = h*60 + m;
         for (j=0;j<S;j++,s++) {
            scanf(" %s",&place[s]);
            if (j < S-1) {
               scanf("%d:%d",&h,&m);
               start[s+1] = (start[s] + h*60 + m) % (60*24);
               d[s][s+1] = h*60+m;
            }
         }
      }
      for (i=0;i<s;i++) for (j=0;j<s;j++) {
         if (strcmp(place[i],place[j])) continue;
         d[i][j] = (24*60 + start[j] - start[i]) % (24*60);
      }
      for (i=0;i<s;i++) for (j=0;j<s;j++) for (k=0;k<s;k++) {
         if (d[j][i]+d[i][k] < d[j][k]) d[j][k] = d[j][i]+d[i][k];
      }
      scanf(" %s %s",from,to);
      nt = 0;
      for (i=0;i<s;i++) {
         if (strcmp(place[i],from)) continue;
         for (j=0;j<s;j++) {
            if (strcmp(place[j],to)) continue;
            if (d[i][j] > 32<<24) continue;
            travel[nt].go = start[i];
            travel[nt++].dur = d[i][j];
         }
      }
      qsort(travel,nt,sizeof(struct tt),comp);
      for (i=0;i<nt;i++) {
         for (j=i+1;j<nt;j++) {
            if (travel[j].go >= travel[i].go && 
                travel[j].go+travel[j].dur <= travel[i].go+travel[i].dur) break;
         }
         if (j<nt) continue;
         for (j=0;j<nt;j++) {
            if (travel[j].go+60*24 >= travel[i].go &&
                travel[j].go+60*24+travel[j].dur <= travel[i].go+travel[i].dur) break;
         }
         if (j<nt) continue;
         printf("%02d:%02d %d:%02d\n",travel[i].go/60,travel[i].go%60,
                      travel[i].dur/60, travel[i].dur%60);
      }
   }
}

#include <stdio.h>

char g[3][4];

int i,j,k,m,n,N,xcount,ocount;

int win(char c){
   int i,j;
   for (i=0;i<3;i++) {
      for (j=0;j<3 && g[i][j]==c;j++);
      if (j==3) return 1;
      for (j=0;j<3 && g[j][i]==c;j++);
      if (j==3) return 1;
   }
   for (i=0;i<3 && g[i][i]==c;i++);
   if (i==3) return 1;
   for (i=0;i<3 && g[i][2-i]==c;i++);
   if (i==3) return 1;
   return 0;
}

main(){
   scanf("%d",&N);
   while (N--){
      scanf(" %s %s %s",g[0],g[1],g[2]);
      xcount = ocount = 0;
      for (i=0;i<3;i++) for (j=0;j<3;j++) {
         if (g[i][j] == 'X') xcount++;
         if (g[i][j] == 'O') ocount++;
      }
      /*printf("x %d o %d xwin %d owin %d\n",xcount,ocount,win('X'),win('O'));*/
      if (
         ocount > xcount || xcount > ocount + 1
         || win('X') && win('O') 
         || win('O') && xcount != ocount
         || win('X') && xcount == ocount
      ) {
         printf("no\n");
         continue;
      }
      printf("yes\n");
   }
}

#include <stdio.h>
#include <string.h>
#include <math.h>

int i,j,k,m,n,N,sum,side,tot;
int s[30];
char d[32*1024*1024];

int doit(int n, int sum, int mask) {
   int i,j,k;
   if (d[mask]) return 0;
   if (sum > side) return 0;
   if (sum == side) sum = 0;
   if (n == m && !sum) return 1;
   d[mask] = 1;
   for (i=0;i<m;i++) {
      if (mask & (1<<i)) continue; // already used
      if (doit(n+1,sum+s[i],mask | (1<<i))) {
         tot += s[i];
         return 1;
      }
   }
   return 0;
}


main(){
   scanf("%d",&N);
   while(N--){
      scanf("%d",&m);
      for (i=0;i<m;i++) scanf("%d",&s[i]);
      for (i=sum=0;i<m;i++) sum += s[i];
      side = sum/4;
      if (side * 4 != sum) {
         printf("no\n");
         continue;
      }
      memset(d, 0, 1<<m);

      tot = 0;
      if (doit(0,0,0)) printf("yes\n");
      else printf("no\n");
   }
}

#include <stdio.h>

int C,N,i,j,k,area,best;

main(){
   scanf("%d",&C);
   while (C--) {
      scanf("%d",&N);
      best = 1000*1000*1000;
      for (i=1;i*i*i<=N;i++) {
         for (j=i;i*j*j<=N;j++) {
            if (N%(i*j)) continue;
            k = N/(i*j);
            area = 2*i*j + 2*i*k + 2*j*k;
            if (area < best) best = area;
         }
      }
      printf("%d\n",best);
   }
}

#include <stdio.h>
#include <string.h>

#define min(x,y) ((x)<(y)?(x):(y))

double htx[6000];
#define ht (htx+3000)

int leftx, rightx, L,R,i,j,k,ii,jj;
double rheight,lheight,rneed,lneed,need, H,vol;

main(){
   while (2 == scanf("%d%d",&leftx,&rightx) && leftx) {
      memset(htx,0,sizeof(htx));
      vol = 0;
      ht[leftx-2] = ht[rightx+2] = 0x7fffffff;
      for (i=leftx;i<=rightx;i+=2) scanf("%lf",&ht[i]);
      L = -1;  R = 1;
      while (ht[leftx] > ht[leftx+1] && ht[rightx] > ht[rightx-1]) {
         H = min(ht[L],ht[R]);
         if (ht[L+1] < H || ht[R-1] < H) {
            for (i=L+1;i<=R-1;i+=2) {
               vol += 2 * (H - ht[i]);
               ht[i] = H;
            }
            continue;
         }
         if (ht[R-1] == ht[R]) {
            for (i=R-1;ht[i] >= ht[i+1];i+=2);
            for (j=i;ht[i] == ht[j];j-=2);
            rheight = min(ht[i+1],ht[0]);
            rheight = min(rheight,ht[j+1]);
            rneed = (rheight - ht[i]) * (i-j);
         } else rheight = rneed = 0;
         if (ht[L+1] == ht[L]) {
            for (ii=L-1;ht[ii] >= ht[ii-1];ii-=2);
            for (jj=ii;ht[ii] == ht[jj];jj+=2);
            lheight = min(ht[ii-1],ht[0]);
            lheight = min(lheight,ht[jj-1]);
            lneed = (lheight - ht[ii]) * (jj-ii);
         } else lneed = lheight = 0;
         if (rneed) for (k=j+2;k<=i;k+=2) {
            if (lneed && lneed < rneed) 
               ht[k] += (rheight-ht[i]) * lneed/rneed;
            else
               ht[k] = rheight;
         }
         if (lneed) for (k=jj-2;k>=ii;k-=2) {
            if (rneed && rneed < lneed) 
                ht[k] +=  (lheight-ht[ii]) * rneed/lneed;
            else 
                ht[k] = lheight;
         }
         if (lneed && rneed) vol += 2 * min(lneed,rneed);
         else vol +=  (lneed+rneed);
         while (ht[R+1] == ht[R-1]) R+=2;
         while (ht[L-1] == ht[L+1]) L-=2;
      }
      printf("%0.0lf\n",vol);
   }
}
